                's_observacion' => 'SE ABORDA EL CASO DEL ADOLESCENTE EN COMITÉ MISIONAL, TENIENDO EN CUENTA QUE SE RECIBE COMUNICACIÓN DEL ÁREA SOCIOLEGAL, INFORMANDO LA PRESENCIA DE HAROLD EN LA SEDE DE CALLE 15 SOLICITANDO RETORNAR AL PROGRAMA. EN COMITÉ SE REVISAN LOS ANTECEDENTES DEL ADOLESCENTE, Y LA INFORMACIÓN CONSIGNADA EN SIMI, ENCONTRANDO QUE LLEVA UN LARGO PROCESO EN IDIPRON, Y QUE YA SE HA EVADIDO CON ANTERIORIDAD. EN EL PROCESO LLEVADO A CABO CON LA UPI EDÉN, SE EVIDENCIA QUE EL ADOLESCENTE ES VARIABLE EN SU COMPORTAMIENTO, ASÍ MISMO HABÍA MANIFESTADO EN VARIAS OPORTUNIDADES QUE DESEABA EVADIRSE DE LA UNIDAD, YA QUE SE SENTÍA INCONFORME CON SU PROCESO ACADÉMICO. ESTAS MANIFESTACIONES FUERON ATENDIDAS POR EL EQUIPO DE LA UNIDAD, QUE ADELANTO INTERVENCIONES, SENSIBILIZACIONES, Y ACUERDOS PARA QUE HAROLD TERMINARA SU PROMOCIÓN Y PUDIERA SER TRASLADADO, SIN EMBARGO, A PESAR DE TODAS LAS ACCIONES ADELANTADAS FINALMENTE SE EVADE EL DÍA 7 DE MAYO, DONDE SE DA REPORTE A LA LÍNEA 141 BAJO EL RADICADO 1762565776. Y SE INFORMA INMEDIATAMENTE A LA RED FAMILIAR, CONSIGNADO EN SIMI DICHAS ACCIONES INMEDIATAMENTE.
